    value: 1.  The payments for exempt FEA printing were for John McCain yard signs
      and bumper stickers.  The materials were distributed by volunteers and did not
      contain express advocacy.    2. The payments totaling $12,651.34 for postage
      and printing were for fundraising activities for our federal account. They did
      not refer to a clearly identified candidate for Federal office and did not promote,
      support, attack, or oppose any candidate for federal office; therefore does
      not meet the definition of Federal Election Activity under 11 CFR 100.24.    3.  The
      disbursement on Schedule B to AIA Corporation on 9/9/09 was for a national delegation
      event; specifically a room rental fee.  The disbursement on Schedule B to Hilton
      Minneapolis on 9/5/09 was for a national delegation event; specifically food
      & beverage and room rental.    4.  The expenditures for food & beverage and
      event expense were not for any fundraising activities.  They did not refer to
      a clearly identified candidate for Federal office and did not promote, support,
      attack, or oppose any candidate for federal office; therefore does not meet
      the definition of Federal Election Activity under 11 CFR 100.24.  They were
      for a state executive committee meeting.    5.  This was a data entry error.  The
      disbursement to Bank of America on 9/29/09 for $2,956.27 was the joint activity
      and the joint activity memo entries associated with that disbursement were the
      disbursements to the Hyatt Regency Hotel, FedEx and Topica, which total to $2,956.27.  We
      have corrected the report and as a result of correcting the data entry error,
      the cash on hand for the period ending cash on hand has decreased by $2,956.27.  We
      will amend all reports following this report to reflect the appropriate totals.
